import "./App.css";

import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

import Footer from "./components/common/footer/Footer";

function admin() {
  return (
    <>
      <Router>
        <Routes>
          <Route path="/admin/add" element={<courseAdd />} />
        </Routes>
        <Footer />
      </Router>
    </>
  );
}

export default admin;
